import React, { Component } from "react";
import { MDBNotification } from "mdbreact";

class Notification extends Component {
    render() {
        return (
            <MDBNotification
                show
                fade
                title="Bootstrap"
                message={this.props.message}
                text="11 mins ago"
                autohide = '1000'
                style={{
                    position: "absolute",
                    top: 0,
                    right: 0
                  }}
            />
        );
    }
}

export default Notification;
